import React, { Component } from 'react';

export default class Autor extends Component {
  render() {
    return (

      <header className="App-header">
        <h1>Autor.</h1>
        <h3>Leroy Deniz</h3>
        <p>Grado en Ingeniería Informática<br />
          Especialidad Ingeniería de Software<br /><br />
          (+34) 669 987 109<br />
          leroydeniz <code>[at]</code> icloud.com<br /><br />
          <code>https://leroydeniz.com</code>
        </p>
      </header>
    );
  }
}
